import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Icon from '@material-ui/core/Icon';
import IconButton from '@material-ui/core/IconButton';

const styles = {
  menuButton: {
    marginRight: 7,
    height: 36,
    width: 36,
  },
  appbar: {
    height: 48,
  },
  toolbar: {
    marginLeft: 7,
    marginRight: 7,
  },
};

class Shell extends Component {

  render() {
    const { classes } = this.props;

    return (
      <AppBar position="fixed" classes={{root: classes.appbar}}>
        <Toolbar variant="dense" disableGutters classes={{root: classes.toolbar}}>
          <IconButton color="inherit" aria-label="Menu" classes={{root: classes.menuButton}}>
            <Icon style={{lineHeight:36}}>menu</Icon>
          </IconButton>
          <Typography variant="h6" color="inherit" className={classes.grow}>
            {this.props.title || 'Untitled'}
          </Typography>
        </Toolbar>
      </AppBar>
    );
  }
}

Shell.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Shell);
